import React from 'react'

const Header = ({ name }) => {
	console.log(name)
	return <h1>{name}</h1>
}

const App = () => {
	const course = {
		name: 'Half Stack application development',
		parts: [
			{
				name: 'Fundamentals of React',
				exercises: 10
			},
			{
				name: 'Using props to pass data',
				exercises: 7
			},
			{
				name: 'State of a component',
				exercises: 14
			}
		]
	}

	return (
		<div>
			<Header course={course} />
		</div>
	)
}
export default App
